import './assets/css/App.css';
import React, {useState} from 'react';
import List from './components/List.jsx'
import Form from './components/Form.jsx'

function App() {

  const todoList = [
    {id: 1, task: 'Clean my room', priority: "Medium", done: false},
    {id: 2, task: 'Cook', priority: "Low", done: false},
    {id: 3, task: 'Laundry', priority: "High", done: false}
  ]

  const [toDos, setTodos] = useState(todoList)

  return (
    <div className="App">
      <header className="App-header">
        TODO LIST
      </header>
      <section className="App-body">
      <Form />
      <List toDos={toDos}/>
      </section>
    </div>
  );
}

export default App;
